// import library
import React, {Component} from 'react';
import Bmi from './Components/Bmi';

class App extends Component{
  render(){
    return(
      <div className="parent-box">
        <div className="container">
          <div className="row">
            <Bmi/>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
